import React from 'react';

import {AppBar, Toolbar, Button, Box, Icon} from '@material-ui/core';
import {Typography} from '@material-ui/core';

const nav = props => {
    return (
        <div>
        <AppBar position="static">
                <Toolbar>
                    <Box display='flex' felxDirection='row'
                        style={
                            {width: '100%'}
                        }
                        justifyContent='space-around'
                        alignItems="center">
                        <Typography color='inherit' variant='h6'>
                            ToDo app
                        </Typography>
                        <Button color="inherit" variant="outlined" onClick={props.handleClick('ADD')}>
                            <Icon>
                              add
                            </Icon>
                        </Button>
                    </Box>
                </Toolbar>
            </AppBar>
        </div>
    );
}

export default nav;
